import React from "react";
import { Button } from 'react-bootstrap';
import "./sync-bar.scss";

const SyncBar = props =>{

    return (
        <div className="sync-bar">
            <Button className="sync-btn">Sync</Button>
            <Button className="master-btn">Master</Button>
            
        </div>
    )
}

export default SyncBar;
